  false,\n\t\"url\": null,\n\t\"notes\": \"This document discusses the resource values
  that have been or will be detrimentally impacted without reasonable regulations
  on Kenai National Wildlife Refuge.  Since 1941, harvest methods, seasons, and access
  restrictions have been used on a permanent or temporary basis in cooperation with
  the State of Alaska. Although aircraft and motorboats have been allowed, their uncontrolled
  use by a large number of persons has been proven detrimental to resources. Without
  exception, every case of over-harvest or critical wildlife disturbance was related
  to heavy motorized access into remote areas. State regulations, such as prohibiting
  same day airborne hunting and localized prohibitions against the use of aircraft
  or off-road vehicles for big game hunting were responses to critical situations.
  Prior to restricting aircraft in the 1960'su2014local guides were literally selling
  \"moose on the hoof.\" They were shooting a moose, loading and flying it outu2014all
  in the same afternoon (refuge files). The Kenai NWR CCP addresses both the positive
  and negative benefits of various access means outlining reasonable access goals
  that balance protecting wildlife with reasonable access opportunity.\",\n\t\"owner_org\":
